import { render } from '@testing-library/react';
import React from 'react';

function Background() {
  const fundo = './galaxyNightView.jpg';
  render(
    <div
      style={ {
        backgroundImage: `url(${fundo})` } }
    >
      {props.children}
    </div>,
  );
}

export default Background;
